import React, { useEffect, useState } from "react";
import axios from "axios";
import Intro from "./Intro";
import List from "./List";
import Card from "./Card";
import Projo from "./Projo";

function Home() {
  const [users, setUsers] = useState(null);  
  const [loading, setLoading] = useState(true);  
  const [error, setError] = useState(null);  

  useEffect(() => {
    const fetchData = async () => {
      try {
        const url = "http://127.0.0.1:5556/user_investors";
        const response = await fetch(url);

        if (!response.ok) {
          throw new Error("Network response was not ok");
        }

        const data = await response.json();
        setUsers(data.User_investors);
        setLoading(false);
      } catch (error) {
        setError(error.message);
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <>
      <section id="landing">
        <Intro />
      </section>
      <section id="projects" className="flex flex-col justify-center items-center mr-6 mt-2">
        <div className="custom-grid">
          <div className="custom-grid-item"><Card /></div>
          <div className="custom-grid-item">
            {loading && <p>Loading...</p>}
            {error && <p className="text-red-500">Error: {error}</p>}
            {users && <List users={users} />}
          </div>
          <div className="custom-grid-item"><Projo /></div>
        </div>
      </section>
    </>
  );
}

export default Home;
